import React, { Component } from 'react'
import './News.css'

export default class News extends Component {
    render() {
        return (

            <div className="news">

                <h1>ประชาสัมพันธ์</h1>

                <span>ข่าว 1 </span>
                <span>ข่าว 2 </span>
                <span>ข่าว 3 </span>
                <span>ข่าว 4 </span>
                <span>ข่าว 5 </span>

            </div>
        )
    }
}
